  true,\n\t\"url\": null,\n\t\"notes\": \"The NASA Low-Cost Small Spacecraft Program
  is focused on the technologies, subsystems, methodologies, and mission concepts
  for space missions which lower the over-all cost for scientific exploration.  We
  propose to support these effort through building a \"simulation-of-simulations\"
  software suite that allows (a) development of a standard small satellite architecture
  framework, (b) capture of all available subsystems simulations or engineering models
  that provide design and functionality documentation for small satellite architectural
  elements, (c) supports full small satellite systems physical and functional simulations
  of simulations against mission profile descriptions using the captured subsystem
  sub-simulation elements, and (d) support mission planning and analysis trade-studies
  that change subsystem and system parameters, supports inclusion and exclusion of
  alternative subsystem elements, and supports mission effectiveness parameter evaluation
  and display (including cost optimization or optimization a particular performance
  factors).rnrn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
